cy.get('.utility-moment').contains('3:38 PM').should('have.class', 'badge'); // the time in the element should be between 3pm and 5pm
var start = Cypress.moment('3:00 PM', 'LT');
var end = Cypress.moment('5:00 PM', 'LT');
cy.get('.utility-moment .badge').should(function ($el) {
  // parse American time like "3:38 PM"
  var m = Cypress.moment($el.text().trim(), 'LT'); // display hours + minutes + AM|PM
  var f = 'h:mm A';
  expect(m.isBetween(start, end), "".concat(m.format(f), " should be between ").concat(start.format(f), " and ").concat(end.format(f))).to.be["true"];
});

// https://on.cypress.io/promise
var waited = false;
/**
 * @return Bluebird<string>
 */
function waitOneSecond() {
  // return a promise that resolves after 1 second
  // @ts-ignore TS2351 (new Cypress.Promise)
  return new Cypress.Promise(function (resolve, reject) {
    setTimeout(function () {
      // set waited to true
      waited = true; // resolve with 'foo' string
      resolve('foo');
    }, 1000);
  });
}
cy.then(function () {
  return (// return a promise to cy.then() that
    // is awaited until it resolves
    // @ts-ignore TS7006
    waitOneSecond().then(function (str) {
      expect(str).to.eq('foo');
      expect(waited).to.be["true"];
    })
  );
});
